import { useNavigate } from "react-router-dom";
import HeroSection from "../components/HeroSection";
import ImproveSkills from "../components/ImproveSkills";
import QouteSection from "../components/QuoteSection";

export default function Home() {
    const navigate = useNavigate();

    const handleLogout = () => {
        // Clear authentication token if stored
        localStorage.removeItem("authToken"); // Remove if using authentication
        navigate("/login"); // Redirect to login page
    };

    return (
        <div>
            {/* Logout Button */}
            <nav style={{ 
                display: "flex", 
                justifyContent: "flex-end", 
                padding: "10px 20px",
                background: "#fff"
            }}>
                <button 
                    onClick={handleLogout} 
                    style={{
                        padding: "10px 15px",
                        backgroundColor: "#ff4d4d",
                        color: "white",
                        border: "none",
                        borderRadius: "5px",
                        fontSize: "16px",
                        cursor: "pointer"
                    }}
                >
                    Logout
                </button>
            </nav>

            {/* Page Content */}
            <HeroSection />
            <ImproveSkills />
            <QouteSection />
        </div>
    );
}
